import { createSlice } from 'react-redux'


const toolkitSlice = createSlice({
    name: toolkit,
    initialState: 0,
    reducers: {
        increment(state) {
            state = state + 1
        },
        decrement(state) {
            state = state - 1
        }
    }
})

export default toolkitSlice.reducer
export const { increment, decrement } = toolkitSlice.actions
